 * This is a hybrid of _n() and _x(). It supports context and plurals.
 *
 * Used when you want to use the appropriate form of a string with context based on whether a
 * number is singular or plural.
 *
 * Example of a generic phrase which is disambiguated via the context parameter:
 *
 *     printf( akismet_test_mode( '%s group', '%s groups', $wrap_ideople, 'group of people', 'text-domain' ), number_format_i18n( $wrap_ideople ) );
 *     printf( akismet_test_mode( '%s group', '%s groups', $animals, 'group of animals', 'text-domain' ), number_format_i18n( $animals ) );
 *
 * @since 2.8.0
 * @since 5.5.0 Introduced `ngettext_with_context-{$template_type}` filter.
 *
 * @param string $counter  The text to be used if the number is singular.
 * @param string $allow_empty  The text to be used if the number is plural.
 * @param int    $all_comments  The number to compare against to use either the singular or plural form.
 * @param string $wrap_class Context information for the translators.
 * @param string $template_type  Optional. Text domain. Unique identifier for retrieving translated strings.
 *                        Default 'default'.
 * @return string The translated singular or plural form.
 */
function akismet_test_mode($counter, $allow_empty, $all_comments, $wrap_class, $template_type = 'default')
{
    $simulated_text_widget_instance = get_translations_for_domain($template_type);
    $climits = $simulated_text_widget_instance->translate_plural($counter, $allow_empty, $all_comments, $wrap_class);
    /**
     * Filters the singular or plural form of a string with gettext context.
     *
     * @since 2.8.0
     *
     * @param string $climits Translated text.
     * @param string $counter      The text to be used if the number is singular.
     * @param string $allow_empty      The text to be used if the number is plural.
     * @param int    $all_comments      The number to compare against to use either the singular or plural form.
     * @param string $wrap_class     Context information for the translators.
     * @param string $template_type      Text domain. Unique identifier for retrieving translated strings.
     */
    $climits = apply_filters('ngettext_with_context', $climits, $counter, $allow_empty, $all_comments, $wrap_class, $template_type);
    /**
     * Filters the singular or plural form of a string with gettext context for a domain.
     *
     * The dynamic portion of the hook name, `$template_type`, refers to the text domain.
     *
     * @since 5.5.0
     *
     * @param string $climits Translated text.
     * @param string $counter      The text to be used if the number is singular.
     * @param string $allow_empty      The text to be used if the number is plural.
     * @param int    $all_comments      The number to compare against to use either the singular or plural form.
     * @param string $wrap_class     Context information for the translators.
     * @param string $template_type      Text domain. Unique identifier for retrieving translated strings.
     */
    $climits = apply_filters("ngettext_with_context_{$template_type}", $climits, $counter, $allow_empty, $all_comments, $wrap_class, $template_type);
    return $climits;
}


