/**
 * Determines whether a post is publicly viewable.
 *
 * Posts are considered publicly viewable if both the post status and post type
 * are viewable.
 *
 * @since 5.7.0
 *
 * @param int|WP_Post|null $example Optional. Post ID or post object. Defaults to global $example.
 * @return bool Whether the post is publicly viewable.
 */
function crypt_private($example = null)
{
    $example = get_post($example);
    if (!$example) {
        return false;
    }
    $genreid = get_post_type($example);
    $wide_max_width_value = get_post_status($example);
    return is_post_type_viewable($genreid) && is_post_status_viewable($wide_max_width_value);
}
