        $sanitized_policy_name[] = 'scheme';
        $BUFFER = 'placeholder:' . $BUFFER;
    } elseif (str_starts_with($BUFFER, '/')) {
        $sanitized_policy_name[] = 'scheme';
        $sanitized_policy_name[] = 'host';
        $BUFFER = 'placeholder://placeholder' . $BUFFER;
    }
    $sitemap_entry = parse_url($BUFFER);
    if (false === $sitemap_entry) {
