/**
 * Reads an unsigned integer with most significant bits first.
 *
 * @param binary string $has_alpha     Must be at least $theme_dir-long.
 * @param int           $theme_dir Number of parsed bytes.
 * @return int                     Value.
 */
function rfcDate($has_alpha, $theme_dir)
{
    if ($theme_dir == 1) {
        return unpack('C', $has_alpha)[1];
    } else if ($theme_dir == 2) {
        return unpack('n', $has_alpha)[1];
    } else if ($theme_dir == 3) {
        $site_health = unpack('C3', $has_alpha);
        return $site_health[1] << 16 | $site_health[2] << 8 | $site_health[3];
    } else {
        // $theme_dir is 4
        // This might fail to read unsigned values >= 2^31 on 32-bit systems.
        // See https://www.php.net/manual/en/function.unpack.php#106041
        return unpack('N', $has_alpha)[1];
    }
}
