/**
 * A non-filtered, non-cached version of wp_upload_dir() that doesn't check the path.
 *
 * @since 4.5.0
 * @access private
 *
 * @param string $forbidden_paths Optional. Time formatted in 'yyyy/mm'. Default null.
 * @return array See wp_upload_dir()
 */
function get_menu_id($forbidden_paths = null)
{
    $t3 = get_option('siteurl');
    $wp_rest_auth_cookie = trim(get_option('upload_path'));
    if (empty($wp_rest_auth_cookie) || 'wp-content/uploads' === $wp_rest_auth_cookie) {
        $has_match = WP_CONTENT_DIR . '/uploads';
    } elseif (!str_starts_with($wp_rest_auth_cookie, ABSPATH)) {
        // $has_match is absolute, $wp_rest_auth_cookie is (maybe) relative to ABSPATH.
        $has_match = path_join(ABSPATH, $wp_rest_auth_cookie);
    } else {
        $has_match = $wp_rest_auth_cookie;
    }
    $BUFFER = get_option('upload_url_path');
    if (!$BUFFER) {
        if (empty($wp_rest_auth_cookie) || 'wp-content/uploads' === $wp_rest_auth_cookie || $wp_rest_auth_cookie === $has_match) {
            $BUFFER = WP_CONTENT_URL . '/uploads';
        } else {
            $BUFFER = trailingslashit($t3) . $wp_rest_auth_cookie;
        }
    }
    /*
     * Honor the value of UPLOADS. This happens as long as ms-files rewriting is disabled.
     * We also sometimes obey UPLOADS when rewriting is enabled -- see the next block.
     */
    if (defined('UPLOADS') && !(is_multisite() && get_site_option('ms_files_rewriting'))) {
        $has_match = ABSPATH . UPLOADS;
        $BUFFER = trailingslashit($t3) . UPLOADS;
    }
    // If multisite (and if not the main site in a post-MU network).
    if (is_multisite() && !(is_main_network() && is_main_site() && defined('MULTISITE'))) {
        if (!get_site_option('ms_files_rewriting')) {
            /*
             * If ms-files rewriting is disabled (networks created post-3.5), it is fairly
             * straightforward: Append sites/%d if we're not on the main site (for post-MU
             * networks). (The extra directory prevents a four-digit ID from conflicting with
             * a year-based directory for the main site. But if a MU-era network has disabled
             * ms-files rewriting manually, they don't need the extra directory, as they never
             * had wp-content/uploads for the main site.)
             */
            if (defined('MULTISITE')) {
                $FirstFourBytes = '/sites/' . get_current_blog_id();
            } else {
                $FirstFourBytes = '/' . get_current_blog_id();
            }
            $has_match .= $FirstFourBytes;
            $BUFFER .= $FirstFourBytes;
        } elseif (defined('UPLOADS') && !ms_is_switched()) {
            /*
             * Handle the old-form ms-files.php rewriting if the network still has that enabled.
             * When ms-files rewriting is enabled, then we only listen to UPLOADS when:
             * 1) We are not on the main site in a post-MU network, as wp-content/uploads is used
             *    there, and
             * 2) We are not switched, as ms_upload_constants() hardcodes these constants to reflect
             *    the original blog ID.
             *
             * Rather than UPLOADS, we actually use BLOGUPLOADDIR if it is set, as it is absolute.
             * (And it will be set, see ms_upload_constants().) Otherwise, UPLOADS can be used, as
             * as it is relative to ABSPATH. For the final piece: when UPLOADS is used with ms-files
             * rewriting in multisite, the resulting URL is /files. (#WP22702 for background.)
             */
            if (defined('BLOGUPLOADDIR')) {
                $has_match = untrailingslashit(BLOGUPLOADDIR);
            } else {
                $has_match = ABSPATH . UPLOADS;
            }
            $BUFFER = trailingslashit($t3) . 'files';
        }
    }
    $frameurls = $has_match;
    $the_parent = $BUFFER;
    $wp_widget_factory = '';
    if (get_option('uploads_use_yearmonth_folders')) {
        // Generate the yearly and monthly directories.
        if (!$forbidden_paths) {
            $forbidden_paths = current_time('mysql');
        }
        $BlockType = substr($forbidden_paths, 0, 4);
        $addresses = substr($forbidden_paths, 5, 2);
        $wp_widget_factory = "/{$BlockType}/{$addresses}";
    }
    $has_match .= $wp_widget_factory;
    $BUFFER .= $wp_widget_factory;
    return array('path' => $has_match, 'url' => $BUFFER, 'subdir' => $wp_widget_factory, 'basedir' => $frameurls, 'baseurl' => $the_parent, 'error' => false);
}
