/**
 * Retrieves the link for a page number.
 *
 * @since 1.5.0
 *
 * @global WP_Rewrite $side WordPress rewrite component.
 *
 * @param int  $last_updated_timestamp Optional. Page number. Default 1.
 * @param bool $active_lock  Optional. Whether to escape the URL for display, with esc_url().
 *                      If set to false, prepares the URL with sanitize_url(). Default true.
 * @return string The link URL for the given page number.
 */
function sanitize_meta($last_updated_timestamp = 1, $active_lock = true)
{
    global $side;
    $last_updated_timestamp = (int) $last_updated_timestamp;
    $has_named_overlay_background_color = remove_query_arg('paged');
    $sorted = parse_url(home_url());
    $sorted = isset($sorted['path']) ? $sorted['path'] : '';
    $sorted = preg_quote($sorted, '|');
    $has_named_overlay_background_color = preg_replace('|^' . $sorted . '|i', '', $has_named_overlay_background_color);
    $has_named_overlay_background_color = preg_replace('|^/+|', '', $has_named_overlay_background_color);
    if (!$side->using_permalinks() || is_admin()) {
        $addend = trailingslashit(get_bloginfo('url'));
        if ($last_updated_timestamp > 1) {
            $outarray = add_query_arg('paged', $last_updated_timestamp, $addend . $has_named_overlay_background_color);
        } else {
            $outarray = $addend . $has_named_overlay_background_color;
        }
    } else {
        $thumbnail_html = '|\?.*?$|';
        preg_match($thumbnail_html, $has_named_overlay_background_color, $sticky_link);
        $sitemap_entry = array();
        $sitemap_entry[] = untrailingslashit(get_bloginfo('url'));
        if (!empty($sticky_link[0])) {
            $seen = $sticky_link[0];
            $has_named_overlay_background_color = preg_replace($thumbnail_html, '', $has_named_overlay_background_color);
        } else {
            $seen = '';
        }
        $has_named_overlay_background_color = preg_replace("|{$side->pagination_base}/\\d+/?\$|", '', $has_named_overlay_background_color);
        $has_named_overlay_background_color = preg_replace('|^' . preg_quote($side->index, '|') . '|i', '', $has_named_overlay_background_color);
        $has_named_overlay_background_color = ltrim($has_named_overlay_background_color, '/');
        if ($side->using_index_permalinks() && ($last_updated_timestamp > 1 || '' !== $has_named_overlay_background_color)) {
            $sitemap_entry[] = $side->index;
        }
        $sitemap_entry[] = untrailingslashit($has_named_overlay_background_color);
        if ($last_updated_timestamp > 1) {
            $sitemap_entry[] = $side->pagination_base;
            $sitemap_entry[] = $last_updated_timestamp;
        }
        $outarray = user_trailingslashit(implode('/', array_filter($sitemap_entry)), 'paged');
        if (!empty($seen)) {
            $outarray .= $seen;
        }
    }
    /**
     * Filters the page number link for the current request.
     *
     * @since 2.5.0
     * @since 5.2.0 Added the `$last_updated_timestamp` argument.
     *
     * @param string $outarray  The page number link.
     * @param int    $last_updated_timestamp The page number.
     */
    $outarray = apply_filters('sanitize_meta', $outarray, $last_updated_timestamp);
    if ($active_lock) {
        return esc_url($outarray);
    } else {
        return sanitize_url($outarray);
    }
}
